import os
from pathlib import Path
import base64
from PIL import Image
from io import BytesIO

def setup_storage():
    appdata = os.getenv('APPDATA')
    if not appdata:
        raise EnvironmentError("NÃ£o consegui ler %APPDATA%")
    storage_dir = Path(appdata) / 'projetoFatura'
    storage_dir.mkdir(parents=True, exist_ok=True)
    for fname in ('pagina.txt', 'formatado.csv', 'formatado_limpo.csv'):
        (storage_dir / fname).touch(exist_ok=True)
    return storage_dir

STORAGE_DIR = setup_storage()

def salvar_icone_base64(b64_string, output_path):
    data = base64.b64decode(b64_string)
    pil_img = Image.open(BytesIO(data))
    pil_img.save(output_path, format="ICO")

def obter_icone_path():
    storage_dir = setup_storage()
    icon_path = storage_dir / "icone.ico" 
    if not icon_path.exists():
        icone_b64 = """
        
        """  
        salvar_icone_base64(icone_b64, icon_path)
    
    return icon_path